import React, { useState, useEffect, useRef } from 'react';
import { useParams, useNavigate, useLocation } from 'react-router-dom';
import { FaArrowLeft, FaUsers } from 'react-icons/fa';
import ReactPlayer from 'react-player';
import WatchParty from '../components/WatchParty';
import api from '../services/api';
import './Watch.css';

const Watch = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const location = useLocation();
  const [movie, setMovie] = useState(null);
  const [videoUrl, setVideoUrl] = useState('');
  const [loading, setLoading] = useState(true);
  const [isWatchParty, setIsWatchParty] = useState(false);
  const [showWatchPartyButton, setShowWatchPartyButton] = useState(true);
  
  const videoRef = useRef(null);
  
  // Check if this is a watch party from URL params
  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const watchPartyParam = params.get('watchParty');
    
    if (watchPartyParam === 'true') {
      setIsWatchParty(true);
      setShowWatchPartyButton(false);
    }
  }, [location]);

  useEffect(() => {
    const fetchMovieAndVideo = async () => {
      try {
        setLoading(true);
        
        // Fetch movie details
        const movieData = await api.getMovieDetails(id);
        setMovie(movieData);
        
        // Fetch videos
        const videos = await api.getMovieVideos(id);
        
        // Find a trailer or any video
        const trailer = videos.find(video => video.type === 'Trailer' && video.site === 'YouTube') || videos[0];
        
        if (trailer) {
          setVideoUrl(`https://www.youtube.com/watch?v=${trailer.key}`);
        } else {
          // Fallback video if no trailer is found
          setVideoUrl('https://www.youtube.com/watch?v=dQw4w9WgXcQ');
        }
      } catch (error) {
        console.error('Error fetching movie and video:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchMovieAndVideo();
  }, [id]);

  const handleBack = () => {
    navigate(-1);
  };
  
  const startWatchParty = () => {
    // Update URL to indicate this is a watch party
    const newUrl = `${location.pathname}?watchParty=true`;
    window.history.pushState({ path: newUrl }, '', newUrl);
    
    setIsWatchParty(true);
    setShowWatchPartyButton(false);
  };

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  return (
    <div className="watch-page">
      <div className="watch-back" onClick={handleBack}>
        <FaArrowLeft />
        <span>Back to Browse</span>
      </div>
      
      {showWatchPartyButton && (
        <button className="watch-party-button" onClick={startWatchParty}>
          <FaUsers />
          <span>Start Watch Party</span>
        </button>
      )}
      
      <div className={`video-container ${isWatchParty ? 'with-watch-party' : ''}`}>
        {videoUrl ? (
          <ReactPlayer
            ref={videoRef}
            url={videoUrl}
            width="100%"
            height="100%"
            controls
            playing
            config={{
              youtube: {
                playerVars: { showinfo: 1 }
              }
            }}
            onPlay={() => {
              if (isWatchParty && videoRef.current) {
                // This would trigger the handlePlay function in WatchParty
                // In a real implementation, this would be handled through a ref or context
              }
            }}
            onPause={() => {
              if (isWatchParty && videoRef.current) {
                // This would trigger the handlePause function in WatchParty
              }
            }}
            onSeek={() => {
              if (isWatchParty && videoRef.current) {
                // This would trigger the handleSeek function in WatchParty
              }
            }}
          />
        ) : (
          <div className="video-error">
            <p>Sorry, no video available for this title.</p>
          </div>
        )}
      </div>
      
      {isWatchParty && <WatchParty movieId={id} videoRef={videoRef} />}
      
      {movie && !isWatchParty && (
        <div className="watch-info">
          <h1>{movie.title}</h1>
          <p>{movie.overview}</p>
        </div>
      )}
    </div>
  );
};

export default Watch;
